                # eval("icon.addPixmap(QtGui.QPixmap(\"" + str(icon) + "\"), QtGui.QIcon.Normal, QtGui.QIcon.Off)")
                # item.setIcon(ico)
                ico.addPixmap(QtGui.QPixmap(":/img/img/detail.png"), QtGui.QIcon.Normal, QtGui.QIcon.Off)
